    // Loads all input values in the form from the matching input name/value pair in the local storage
    function form_load(form) {
        $(form).find("input").each(function () {
            var value = window.localStorage.getItem(this.name);
            if (value) {
                if ($(this).is(':radio') || $(this).is(':checkbox')) this.checked = true;
                else this.value = value;
            }
        });

        $(form).find("select").each(function () {
            var value = window.localStorage.getItem(this.name);
            // Only set the selected option if it is saved to the local storage. This enables the drop down to have a default if no value is saved previously.
            if (value) $(this).val(value);
        });
    }

    // Saves all input values in the form to the local storage in input name/value pairs.
    function form_save(form) {
        var validator = $(form).kendoValidator().data("kendoValidator");
        if (validator.validate()) {
            // save the values of the inputs
            $(form).find("input").each(function () {
                var value = '';
                if ($(this).is(':radio') || $(this).is(':checkbox')) {
                    if (this.checked) value = this.checked;
                }
                else value = this.value;

                window.localStorage.setItem(this.name, value);
            });
            // AW5.app.navigate("#:back");
            
            // save the values of the drop down
            $(form).find("select").each(function () {
                window.localStorage.setItem(this.name, $(this).val());
            });
        }
    }

    // Clears all input in the form
    function form_clear(form) {
        $(form).find("input").each(function () {
            this.value = "";
            this.checked = false;
            window.localStorage.removeItem(this.name);
        });

        $(form).find("select").each(function () {
            $(this).prop('selectedIndex', 0);
        });
        
    }

      
