            /* Camera Functions  */

            function takePhotos(callbackfn){
                AW5.app.showLoading();
                navigator.device.capture.captureImage(
                    function(mediaFiles) {
                        callbackfn(mediaFiles);
                        AW5.app.hideLoading();
                    },
                    function(error) {  
                        onCameraCaptureError(error);
                        AW5.app.hideLoading();
                    },
                    {highRes: false}
                );
            }

            // Called if something bad happens.
            // 
            function onCameraCaptureError(error) {
                var msg;
                switch (error.code) {
                    case CaptureError.CAPTURE_NO_MEDIA_FILES:
                        return;

                    case CaptureError.CAPTURE_NOT_SUPPORTED:
                        msg = 'Image capture is not supported on this device';
                        break;
                    default:
                        msg = 'An error occurred during capture: ' + error.code;
                        break;
                }

                showAlert (msg, null, 'Image Capture');
            }

            function shouldRotateToOrientation(interfaceOrientation) {
                return (1 === interfaceOrientation); // support portrait only
            }
                
            function showAlert(message, callback, title, buttons){
                if (navigator && navigator.notification && navigator.notification.alert){
                    navigator.notification.alert(message, callback, title, buttons);
                }
                else{
                    alert(message);
                }
            }

            function initializeMapping(){
                var gmap3 = document.createElement('script');
                gmap3.type = "text/javascript";
                gmap3.src = "js/gmap3.min.js";
                document.body.appendChild(gmap3);

                var marker = document.createElement('script');
                marker.type = "text/javascript";
                marker.src = "js/geolocationmarker.js";
                document.body.appendChild(marker);
            }

            function shareFacebook() {
                doAppShare("facebook");
            }

            function shareTwitter() {
                doAppShare("twitter");
            }

            function shareEmail() {
                doAppShare("email");
            }

            function shareSMS() {
                doAppShare("sms");
            }

            function doAppShare(type) {

                var shareMessage = (window.localStorage.getItem("shareMessage")) ? window.localStorage.getItem("shareMessage") : ("Check out this app!");

                if (type === "facebook") {
                    if(FACEBOOK_ENABLED === "true") {
                        postToFacebook("link", "", APP_SHARE_URL, "", "Share a friend", shareMessage);
                    }
                    else {
                        var href="http://m.facebook.com/sharer.php?u=" + APP_SHARE_URL;
                        openInAppURL(href);
                    }
                }

                else if (type === "twitter") {
                    if(TWITTER_ENABLED === "true") {
                        tweet("Share a friend", shareMessage);
                    }
                    else {
                        var href="https://twitter.com/intent/tweet?text=" + encodeURIComponent(shareMessage);
                        openInAppURL(href);
                    }
                }

                else if (type === "email") {
                    if(kendo.support.mobileOS && window.plugins.emailComposer) {
                        window.plugins.emailComposer.showEmailComposerWithCallback(function(){}, "Check this app out", shareMessage, [], [], [], false, null);
                    }
                    else {
                        document.location.href = "mailto:?subject=Check%20this%20app%20out!&body=" + encodeURIComponent(shareMessage);
                    }
                }

                else if (type === "sms") {
                    document.location.href = "sms:?body=" + encodeURIComponent(shareMessage);
                }
            }

            function shareVehicle(type, data) {
                var vehicleData = data;
                var newLineChar = (kendo.support.mobileOS) ? "<br/>" : "\n";
                var message = "Check out this " + vehicleData.year + " " + vehicleData.make + " " + vehicleData.model;
                
                switch (type) {
                    case "twitter":
                        tweet(message, APP_SHARE_URL, imageUrl);
                    break;

                    case "facebook":
                        postToFacebook("link", "", APP_SHARE_URL, imageUrl, "Share a friend", message);
                    break;

                    case "email":
                        var subject = vehicleData.make + " " + vehicleData.model + " " + vehicleData.year;
                        message +=  newLineChar + "You can find it in this app" + newLineChar + APP_SHARE_URL;

                        var imageUrl = "";
                        if (vehicleData.galleryItems != null && vehicleData.galleryItems.length > 0) {
                            imageUrl = vehicleData.galleryItems[0].thumbUrl;
                        }

                        if(kendo.support.mobileOS && window.plugins.emailComposer) {
                            window.plugins.emailComposer.showEmailComposerWithCallback(
                                function() {
                                    if (emailCallback == 2) {
                                        logInteraction('E-Mail', moduleId, 'Vehicle shared');
                                    }
                                }, subject, message, [], [], [], true, null);
                        }
                        else {
                            document.location.href = "mailto:?subject=" + subject + "&body=" + encodeURI(message);
                        }

                    break;
                }
            }

            function shareProperty(type, data) {
                var property = data.streetNumber + ' ' + data.streetName + ' ' + data.streetType + ' ' + data.suburb;
                if (data.unitNumber) address = data.unitNumber + '/' + address;
                var message = "Check this out from my app: " + property;
                var newLineChar = (kendo.support.mobileOS) ? "<br/>" : "\n";

                var imageUrl = "";
                if (data.galleryItems != null && data.galleryItems.length > 0) {
                    imageUrl = data.galleryItems[0].thumbUrl;
                }

                switch (type) {
                    case "twitter":
                        tweet(message, APP_SHARE_URL, imageUrl);
                    break;

                    case "facebook":
                        postToFacebook("link", "", APP_SHARE_URL, imageUrl, "Share a friend", message);
                    break;

                    case "email":
                        if (imageUrl) {
                            message += newLineChar;

                            $(data.galleryItems).each(function() {
                                if (kendo.support.mobileOS.ios) {
                                    message += "<img src=" + this.thumbUrl + "/>" + newLineChar;
                                }
                                else message += this.thumbUrl + newLineChar;
                            });
                        }

                        if(kendo.support.mobileOS && window.plugins.emailComposer) {
                            window.plugins.emailComposer.showEmailComposerWithCallback(
                                function() {
                                    if (emailCallback == 2) {
                                        logInteraction('E-Mail', moduleId, 'Property shared');
                                    }
                                }, "Share a friend", message, [], [], [], true, null);
                        }
                        else {
                            document.location.href = "mailto:?subject=Share%20a%20friend&body=" + encodeURI(message);
                        }

                    break;
                }
            }

            


